Actualmente se realizaron <b>4 muestreos</b>, en los que se recolectaron <b>32 muestras de agua</b>.

En todos los casos, no se aprecia presencia de nubes sobre los puntos de toma de muestras.

Los ocho sitios muestrales se nombran correlativamente de `P1` a `P8`, iniciando en la orilla chaqueña y finalizando en la costa de Corrientes, pasado de color <b span='color:{r c1}'>azul</b> a <b span='color:{r c2}'>rojo</b>.

